import React from 'react';
import './content_about.css';


class ContentAbout extends React.Component{
  render(){
    return(
      <div id="contentabout" class="container-fluid">
        <div class="infohead col-12">
           <div class="line"></div>
           <h1 class="abouth">How it works?</h1>
           <h6 class="abouth6">Step by step</h6>
         </div>
         {AboutJson.map((item)=>{
           return(
             <div className={item.cName}>
                <div id={item.id}>
                  <div dangerouslySetInnerHTML={{__html:item.text}}>
                  </div>
               </div>
             </div>
           )
         }
         )}

         <div class="col-12 text-center endabout">
           <span class="font-weight-bold">You get your package to your home &#10069; </span>
         </div>
      </div>
    )
  }
}
export default ContentAbout
